import React, { useState, useEffect, } from "react";
import { Card } from "../../components/Card";
import { Container } from "../../components/Grid";
import CAMPAIGN from '../../Utils/CAMPAIGN'



function Main(){
    
    const [state, setState] = useState({campaign: []})
    useEffect(()=>{
        const remoteCampaignPromise = CAMPAIGN.getCampaigns();
        remoteCampaignPromise.then((items)=>{
          console.log(items)
          const transformedCampaign = items.data.campaigns
        
          console.log(transformedCampaign)
          setState((prevState)=> ({
              ...prevState,
              campaign: transformedCampaign,
          }));
        });
    }, []);


return(
<div className='card-deck'>
    {state.campaign.map((item)=>(
        <Card key={item.id} name={item.campaign_name} pay={item.pay_per_install} url={item.campaign_icon_url}/>
    ))}
</div>
    
)
}

export default Main;
